import React from 'react'

var stylingObjects={
    container:{
        display: "flex",
        textAlign: "center",
        justifyContent: "center",
        height: "200px",
        background: "##F25044"
    }
}

function Footer(){
    return(
        <div style={stylingObjects.container}>
            NAME
        </div>
    )
}

export default Footer;
